import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Routes, Route, BrowserRouter } from 'react-router-dom';
import Registration from './Pages/Registration/Registration';
import Event from './Pages/Events/Event';
import Home from './Components/Home/Home';
import Navbar from './Components/Navbar/Navbar';
import Footer from './Components/Footer/Footer';
import Contact from './Pages/Contact/Contact';
import Gallery1 from './Components/Gallery/Gallery1';
import Gallery2 from './Components/Gallery/Gallery2';
import Gallery3 from './Components/Gallery/Gallery3';
import Gallery4 from './Components/Gallery/Gallery4';
import Gallery5 from './Components/Gallery/Gallery5';



function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar />
        <div className='main'>
          <Routes>
            <Route path="/" element={<Home />}></Route>
            <Route path='/gallery-2011' element={<Gallery1 />} />
            <Route path='/gallery-2012' element={<Gallery2 />} />
            <Route path='/gallery-2018' element={<Gallery3 />} />
            <Route path='/gallery-2019' element={<Gallery4 />} />
            <Route path='/gallery-Alumni' element={<Gallery5 />} />
            <Route path="/events" element={<Event />}></Route>
            <Route path="/registration" element={<Registration />}></Route>
            <Route path="/Contact" element={<Contact />}></Route>
          </Routes>
        </div>
        <div style={{ width: '100%' }}>
          <Footer />
        </div>

      </BrowserRouter>
    </div>
  );
}

export default App;
